import React from 'react'

function FriendsList(props) {
    return(
        <div>
        {props.friendsList.map( friend => {
            return(
              <div>
               <h1>{props.friend.name}</h1>
                <p>{props.friend.age}</p>
                <p>{props.friend.email}</p>
              </div>
            )
          })}
          </div> //end div
    )
}

export default FriendsList;
